import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  const [parcelIDs, setParcelIDs] = useState([]);
  const [provinces, setProvinces] = useState([]);
  const [selectedParcel, setSelectedParcel] = useState("");
  const [selectedProvince, setSelectedProvince] = useState("");

  useEffect(() => {
    // Fetch parcel IDs
    fetch("http://localhost:3333/parcels")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          setParcelIDs(data.parcelIDs);
        } else {
          console.error("Error fetching parcel IDs:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching parcel IDs:", error);
      });

    // Fetch provinces
    fetch("http://localhost:3333/provinces")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          setProvinces(data.provinces);
        } else {
          console.error("Error fetching provinces:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching provinces:", error);
      });
  }, []);

  const handleParcelChange = (event) => {
    setSelectedParcel(event.target.value);
  };

  const handleProvinceChange = (event) => {
    setSelectedProvince(event.target.value);
  };
  return (
    <div>
      <Navbar />
      <div className="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Select parcel</span>
              </label>
              <div className="enterdata">
              <select id="parcelSelector" onChange={handleParcelChange} value={selectedParcel}>
                  {parcelIDs.map((parcelID, index) => (
                    <option key={index} value={parcelID}>
                      {parcelID}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup date</span>
              </label>
              <div className="enterdata">
                <input type="date" />
              </div>
            </div>
            <br />
            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup time</span>
              </label>
              <div className="enterdata">
                <select id="timeSelector">
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            <br />
            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup location detail</span>
              </label>
              <div className="enterdata">
                <input type="text" placeholder="Enter address details" />
              </div>
            </div>
            <br />
            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div className="enterdata">
                <select id="provinceSelector">
                  {provinces.map((province, index) => (
                    <option key={index} value={province.id}>
                      {province.name_th}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <br />
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
